import React from 'react';
import useDocumentTitle from './useDocumentTitle'; // Import the custom hook

const ContactUs = () => {
  useDocumentTitle("Contact Us - Overlays Clothing"); // Set the page title

  return (
    <div>
      <h1>Contact Us</h1>
      {/* Add contact form, information, or other content as needed */}
      <p>If you have any questions, feel free to reach out!</p>
      {/* Add more content such as a contact form or address */}
    </div>
  );
};

export default ContactUs;
